// services/auth/MemberService.js
import axios from "axios";
const baseURL = "http://localhost:8000/api"

// 회원가입(insert)
const insert = (data) => {
    return axios.post(baseURL+"/auth/register", data);
}
const MemberService = {
    insert,
}
export default MemberService;
